import React from "react";

import MyParagraph from "./MyParagraph";

const DemoOutput = (props) => {
  console.log("DemoOutput RUNNING!");
  return (
    <MyParagraph>
      <p>{props.show ? "This is New!" : ""}</p>;
    </MyParagraph>
  );
};

export default DemoOutput;
